import React from 'react';
import { useNavigate } from 'react-router-dom';
import landing from './landing.module.css';
import Foto from '../icono/absol_pokemon.gif';


const Landing = () => {

    const navigate = useNavigate();

    const handleClick = () => {
        navigate('/home')
    };

    return (

     <><div className={landing.esta}>

            <h6 className={landing.titlulo}>Bienvenidos</h6>

            <br />
            <h3>POKEMON Henry 2022</h3>

            <div className={landing.estaButton1}>
                <button onClick={handleClick}>Entrar</button>
            </div>

        </div><img className={landing.logo} src={Foto} alt="" /></>
    )
};

export default Landing;
